    false,nt"url": null,nt"notes": "A total of 191 vegetation field plot samples
    were collected at Voyageurs National Park and environs to support vegetation classification
    development. Teams of ecologists and botanists collected vegetation field data during
    the 1996 through 1998 field seasons. This data was used in an analysis to determine
    and describe the USNVC associations that existed within the project area. This metadata
    report is for 2 database sets containing the physical descriptions aand species
    listing of the vegetation field plot data. The first is a dBASE IV spreadsheet of
    the complete field data of the vegetation field plot physical. The second data set
    contains the Species Listing of the Vegetation Field Plot data. The non-spatial
    data is complete as a dBASE spreadsheet file, which was exported from the PLOTS
    database.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
